function replaceWithAlternatingLetter(arr) {
  let i = 0;
  while (i < arr.length - 1) {
    if (arr[i] === arr[i + 1]) {
      const letterToReplace = arr[i];
      for (let j = i; j < arr.length; j++) {
        if (letterToReplace!== arr[j]) {
          arr[i] = letterToReplace;
          arr[j] = letterToReplace === "a"? "g" : "i";
          break;
        }
      }
    }
    i++;
  }
  return arr;
}
